At Mejuri’s core is our community and commitment to one another. So ahead of International Women's Day, we launched our campaign Golden Together celebrating the strength and beauty of this unique connection. Because when we support each other, our future isn’t just bright— it’s golden. 

These days, communities have taken on new shapes and meanings, so we asked some friends to share what “Golden Together” means to them and here’s what they had to say. 

